import React, { Component } from "react";

export class Logo extends Component {
  render() {
    return (
      <div
        className="container"
        style={{
          height: "70px",
          width: "70px",
          border: "2px solid white",
          position: "absolute",
          margin: "auto",
          left: "0",
          right: "0",
          top: "0",
          bottom: "0",
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
          perspective: "1000px",
          WebkitPerspective: "1000px"
        }}
      >
        <div className="cicle">
          <div />
          <div />
          <div />
        </div>
      </div>
    );
  }
}

export default Logo;
